        <div className="workCard">
        <h2>{props.title}</h2>
        <h4>{props.company}</h4>
        <p>Technology Used:</p>
        {props.techUsed.map((item) => {
            <li></li>
        } )}
        {/* <ul>
            <li>Python</li>,
            <li>React</li>,
            <li>JS</li>
        </ul> */}
        <p>{props.description}</p>
        <p>{props.dateRange}</p>
        </div>

    );
}


export default WorkCard;
